      <React.Fragment>

        <br/>

        <div class="container-fluid">

          <div class="row">
            <div class="col-lg-12 text-left mt-5 mb-5 pl-5">
              <h1> Explore data section </h1>
              <p> Under construction </p>
            </div>
          </div>

        </div>

      </React.Fragment>

    )
  }
}

export default Explore;
